class WomenHairDresserDeals{
    constructor(name){
         this.hairDresserName=name;
        this.hairDresserProfileImage="";
        this.services=[];
    }
    addService=(service,sampleImage,price)=>{
        if(sampleImage===""){
            this.services.push({serviceName:service,serviceImage:"data:image/jpeg;base64,",price:price})
            return;
        }
        this.services.push({serviceName:service,serviceImage:sampleImage,price:price});
        // console.log(this.services)
        
    }
    changeProfileImage(img){
        if(img===""){
            this.hairDresserProfileImage="data:image/jpeg;base64,"
            return;
        }
        this.hairDresserProfileImage=img;
    }
    getSaloonName(){
        return this.hairDresserName
    }
    getServices(){
        return this.services;
    }
    getProfileImage(){
        return this.hairDresserProfileImage;
    }
}

